commits.content:
.full-size-container {
	width: 1140px;
	padding: 0 15px;
	margin: 0 auto;
}
.padding-top-bot-100 {
	padding-top: 100px;
	padding-bottom: 100px;
}
.padding-top-bot-80 {
	padding-top: 80px;
	padding-bottom: 80px;
}
.padding-top-bot-60 {
	padding-top: 60px;
	padding-bottom: 60px;
}
.padding-top-bot-40 {
	padding-top: 40px;
	padding-bottom: 40px;
}
.padding-top-bot-20 {
	padding-top: 20px;
	padding-bottom: 20px;
}

.go-to-top {
	position: fixed;
	bottom: 20px;
	right: 20px;
	z-index: 10;
	width: 40px;
	height: 40px;
	background-color: $primaryBackground;
	border-radius: 50%;
	display: flex;
	justify-content: center;
	align-items: center;
	cursor: pointer;
	ion-icon {
		font-size: 24px;
	}
	box-shadow: 0px 0px 10px 5px #00000070;
}

input {
	&::-webkit-outer-spin-button,
	&::-webkit-inner-spin-button {
		-webkit-appearance: none;
		margin: 0;
	}
	&[type='number'] {
		-moz-appearance: textfield;
	}
}
